// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

/**
 * @title TournamentScores
 * @dev Smart contract to record, manage, and retrieve tournament scores on Avalanche
 * Ensures data integrity and immutability for tournament results
 */
contract TournamentScores {
    
    // Struct to represent a match result
    struct Match {
        uint256 matchId;
        uint256 tournamentId;
        address player1;
        address player2;
        string player1Name;
        string player2Name;
        uint256 player1Score;
        uint256 player2Score;
        address winner;
        uint256 timestamp;
        bool isFinalized;
    }
    
    // Struct to represent a tournament
    struct Tournament {
        uint256 tournamentId;
        string tournamentName;
        uint256 startTime;
        uint256 endTime;
        bool isActive;
        address[] participants;
        uint256 totalMatches;
    }
    
    // State variables
    address public owner;
    uint256 public tournamentCounter;
    uint256 public matchCounter;
    
    // Mappings
    mapping(uint256 => Tournament) public tournaments;
    mapping(uint256 => Match) public matches;
    mapping(uint256 => uint256[]) public tournamentMatches; // tournamentId => matchIds
    mapping(address => uint256[]) public playerMatches; // player address => matchIds
    mapping(address => mapping(uint256 => uint256)) public playerTournamentScore; // player => tournamentId => total score
    
    // Events
    event TournamentCreated(uint256 indexed tournamentId, string name, uint256 startTime);
    event TournamentEnded(uint256 indexed tournamentId, uint256 endTime);
    event MatchRecorded(
        uint256 indexed matchId,
        uint256 indexed tournamentId,
        address indexed winner,
        address player1,
        address player2,
        uint256 player1Score,
        uint256 player2Score
    );
    event ParticipantAdded(uint256 indexed tournamentId, address participant);
    
    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }
    
    modifier tournamentExists(uint256 _tournamentId) {
        require(_tournamentId > 0 && _tournamentId <= tournamentCounter, "Tournament does not exist");
        _;
    }
    
    modifier matchExists(uint256 _matchId) {
        require(_matchId > 0 && _matchId <= matchCounter, "Match does not exist");
        _;
    }
    
    constructor() {
        owner = msg.sender;
        tournamentCounter = 0;
        matchCounter = 0;
    }
    
    /**
     * @dev Create a new tournament
     * @param _name Tournament name
     * @return tournamentId The ID of the created tournament
     */
    function createTournament(string memory _name) public onlyOwner returns (uint256) {
        tournamentCounter++;
        
        Tournament storage newTournament = tournaments[tournamentCounter];
        newTournament.tournamentId = tournamentCounter;
        newTournament.tournamentName = _name;
        newTournament.startTime = block.timestamp;
        newTournament.isActive = true;
        newTournament.totalMatches = 0;
        
        emit TournamentCreated(tournamentCounter, _name, block.timestamp);
        
        return tournamentCounter;
    }
    
    /**
     * @dev Add a participant to a tournament
     * @param _tournamentId Tournament ID
     * @param _participant Participant address
     */
    function addParticipant(uint256 _tournamentId, address _participant) 
        public 
        onlyOwner 
        tournamentExists(_tournamentId) 
    {
        require(tournaments[_tournamentId].isActive, "Tournament is not active");
        require(_participant != address(0), "Invalid participant address");
        
        tournaments[_tournamentId].participants.push(_participant);
        
        emit ParticipantAdded(_tournamentId, _participant);
    }
    
    /**
     * @dev Record a match result
     * @param _tournamentId Tournament ID
     * @param _player1 Player 1 address
     * @param _player2 Player 2 address
     * @param _player1Name Player 1 username
     * @param _player2Name Player 2 username
     * @param _player1Score Player 1 score
     * @param _player2Score Player 2 score
     * @return matchId The ID of the recorded match
     */
    function recordMatch(
        uint256 _tournamentId,
        address _player1,
        address _player2,
        string memory _player1Name,
        string memory _player2Name,
        uint256 _player1Score,
        uint256 _player2Score
    ) public onlyOwner tournamentExists(_tournamentId) returns (uint256) {
        require(tournaments[_tournamentId].isActive, "Tournament is not active");
        require(_player1 != address(0) && _player2 != address(0), "Invalid player addresses");
        require(_player1 != _player2, "Players must be different");
        
        matchCounter++;
        
        // Determine winner
        address winner = _player1Score > _player2Score ? _player1 : _player2;
        
        // Create match record
        Match storage newMatch = matches[matchCounter];
        newMatch.matchId = matchCounter;
        newMatch.tournamentId = _tournamentId;
        newMatch.player1 = _player1;
        newMatch.player2 = _player2;
        newMatch.player1Name = _player1Name;
        newMatch.player2Name = _player2Name;
        newMatch.player1Score = _player1Score;
        newMatch.player2Score = _player2Score;
        newMatch.winner = winner;
        newMatch.timestamp = block.timestamp;
        newMatch.isFinalized = true;
        
        // Update mappings
        tournamentMatches[_tournamentId].push(matchCounter);
        playerMatches[_player1].push(matchCounter);
        playerMatches[_player2].push(matchCounter);
        
        // Update tournament scores
        playerTournamentScore[_player1][_tournamentId] += _player1Score;
        playerTournamentScore[_player2][_tournamentId] += _player2Score;
        
        // Update tournament
        tournaments[_tournamentId].totalMatches++;
        
        emit MatchRecorded(
            matchCounter,
            _tournamentId,
            winner,
            _player1,
            _player2,
            _player1Score,
            _player2Score
        );
        
        return matchCounter;
    }
    
    /**
     * @dev End a tournament
     * @param _tournamentId Tournament ID
     */
    function endTournament(uint256 _tournamentId) 
        public 
        onlyOwner 
        tournamentExists(_tournamentId) 
    {
        require(tournaments[_tournamentId].isActive, "Tournament already ended");
        
        tournaments[_tournamentId].isActive = false;
        tournaments[_tournamentId].endTime = block.timestamp;
        
        emit TournamentEnded(_tournamentId, block.timestamp);
    }
    
    /**
     * @dev Get match details
     * @param _matchId Match ID
     * @return Match details
     */
    function getMatch(uint256 _matchId) 
        public 
        view 
        matchExists(_matchId) 
        returns (Match memory) 
    {
        return matches[_matchId];
    }
    
    /**
     * @dev Get tournament details
     * @param _tournamentId Tournament ID
     * @return Tournament details
     */
    function getTournament(uint256 _tournamentId) 
        public 
        view 
        tournamentExists(_tournamentId) 
        returns (Tournament memory) 
    {
        return tournaments[_tournamentId];
    }
    
    /**
     * @dev Get all matches in a tournament
     * @param _tournamentId Tournament ID
     * @return Array of match IDs
     */
    function getTournamentMatches(uint256 _tournamentId) 
        public 
        view 
        tournamentExists(_tournamentId) 
        returns (uint256[] memory) 
    {
        return tournamentMatches[_tournamentId];
    }
    
    /**
     * @dev Get all matches for a player
     * @param _player Player address
     * @return Array of match IDs
     */
    function getPlayerMatches(address _player) 
        public 
        view 
        returns (uint256[] memory) 
    {
        return playerMatches[_player];
    }
    
    /**
     * @dev Get player's total score in a tournament
     * @param _player Player address
     * @param _tournamentId Tournament ID
     * @return Total score
     */
    function getPlayerTournamentScore(address _player, uint256 _tournamentId) 
        public 
        view 
        tournamentExists(_tournamentId) 
        returns (uint256) 
    {
        return playerTournamentScore[_player][_tournamentId];
    }
    
    /**
     * @dev Get tournament participants
     * @param _tournamentId Tournament ID
     * @return Array of participant addresses
     */
    function getTournamentParticipants(uint256 _tournamentId) 
        public 
        view 
        tournamentExists(_tournamentId) 
        returns (address[] memory) 
    {
        return tournaments[_tournamentId].participants;
    }
    
    /**
     * @dev Transfer ownership
     * @param _newOwner New owner address
     */
    function transferOwnership(address _newOwner) public onlyOwner {
        require(_newOwner != address(0), "Invalid address");
        owner = _newOwner;
    }
}

